import './sidebar.css';
import React from 'react'
import * as FaIcons from "react-icons/md-bi";


function SideBarV1() {
    return (
        <div>
            <div className="sidebar">
                <FaIcons.MdLiveHelp />
                <FaIcons.BiLeftArrow />
            </div>
        </div>
    )
}

export default SideBarV1
